const
    crypto = require('crypto'),
    WebSocket = require('ws'),
    { StringDecoder } = require('string_decoder'),
    EventEmitter = require('eventemitter3'),
    { QRCodeStyling } = require("qr-code-styling-node/lib/qr-code-styling.common.js"),
    nodeCanvas = require("canvas"),
    fs = require("fs");

class client extends EventEmitter {
    constructor(config) {
        super();
        this.path = config.path ?? "./qrcode.png";
        this.template = config.template;
        this.capSolverKey = config.capSovler?.key;
        this.ws = new WebSocket('wss://remote-auth-gateway.discord.gg/?v=2', { headers: { 'Origin': 'https://discord.com' } });
        this.key = crypto.generateKeyPairSync("rsa", {
            modulusLength: 2048,
            publicKeyEncoding: {
                type: 'spki',
                format: 'pem'
            },
            privateKeyEncoding: {
                type: 'pkcs1',
                format: 'pem'
            }
        });
        this.heartbeat_interval = 0;
        this.last_heartbeat = 0;
        this.user = {};
        this.#init();
    }


    async findRealToken(ticket, captchaSolveData = null) {
        const
            headers = {
                Accept: '*/*',
                'Accept-Language': 'en-US',
                'Content-Type': 'application/json',
                'Sec-Fetch-Dest': 'empty',
                'Sec-Fetch-Mode': 'cors',
                'Sec-Fetch-Site': 'same-origin',
                'X-Debug-Options': 'bugReporterEnabled',
                'X-Super-Properties': `${Buffer.from(
                    JSON.stringify({
                        os: 'Windows',
                        browser: 'Discord Client',
                        release_channel: 'stable',
                        client_version: '1.0.9011',
                        os_version: '10.0.22621',
                        os_arch: 'x64',
                        system_locale: 'en-US',
                        client_build_number: 175517,
                        native_build_number: 29584,
                        client_event_source: null,
                        design_id: 0,
                    }),
                    'ascii'
                ).toString('base64')}`,
                'X-Discord-Locale': 'en-US',
                'User-Agent':
                    'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) discord/1.0.9010 Chrome/91.0.4472.164 Electron/13.6.6 Safari/537.36',
                Referer: 'https://discord.com/channels/@me',
                Connection: 'keep-alive',
            };

        let body;
        if (captchaSolveData) {
            body = JSON.stringify({
                ticket: ticket,
                captcha_key: captchaSolveData,
            });
        } else {
            body = JSON.stringify({
                ticket: ticket,
            });
        };

        const
            pageUrl = `https://discord.com/api/v9/users/@me/remote-auth/login`,
            res = await fetch(pageUrl, {
                method: 'POST',
                headers: headers,
                body: body,
                // agent: new HttpsProxyAgent(`http://${proxy}`)
            }),
            data = await res.json();

        if (data.captcha_sitekey) return { ticket, captcha: data }
        else if (data?.encrypted_token) return this.#decryptPayload(data.encrypted_token).toString();
    }

    #init() {
        const
            that = this,
            ws = this.ws;
        ws.onopen = () => that.emit('open');
        ws.onclose = () => that.emit('close');
        ws.onerror = (err) => that.emit('error', err);
        ws.onmessage = async (msg) => {
            const data = JSON.parse(msg.data);
            switch (data.op) {
                case "hello":
                    this.heartbeat_interval = data.heartbeat_interval / 1000;
                    this.last_heartbeat = Date.now() / 1000;
                    this.#heartbeatSender();
                    this.#sendWs("init", { 'encoded_public_key': this.#publicKey() })
                    break;
                case "nonce_proof":
                    this.#sendWs("nonce_proof", {
                        'proof': crypto.createHash('sha256')
                            .update(this.#decryptPayload(data.encrypted_nonce))
                            .digest('base64')
                            .replace(/\+/g, '-')
                            .replace(/\//g, '_')
                            .replace(/=+$/, '')
                    });
                    break;
                case "pending_remote_init":
                    try {
                        const
                            options = {
                                "width": 300, "height": 300, "data": `https://discordapp.com/ra/${data.fingerprint}`, "margin": 0,
                                "qrOptions": { "typeNumber": "0", "mode": "Byte", "errorCorrectionLevel": "Q" },
                                "imageOptions": { "hideBackgroundDots": true, "imageSize": 0.4, "margin": 5 }, "dotsOptions": { "type": "square", "color": "#000000" },
                                "backgroundOptions": { "color": "#ffffff" },
                                "image": `data:image/png;base64,`,
                                "dotsOptionsHelper": { "colorType": { "single": true, "gradient": false }, "gradient": { "linear": true, "radial": false, "color1": "#6a1a4c", "color2": "#6a1a4c", "rotation": "0" } }, "cornersSquareOptions": { "type": "square", "color": "#000000" }, "cornersSquareOptionsHelper": { "colorType": { "single": true, "gradient": false }, "gradient": { "linear": true, "radial": false, "color1": "#000000", "color2": "#000000", "rotation": "0" } }, "cornersDotOptions": { "type": "", "color": "#000000" }, "cornersDotOptionsHelper": { "colorType": { "single": true, "gradient": false }, "gradient": { "linear": true, "radial": false, "color1": "#000000", "color2": "#000000", "rotation": "0" } }, "backgroundOptionsHelper": { "colorType": { "single": true, "gradient": false }, "gradient": { "linear": true, "radial": false, "color1": "#ffffff", "color2": "#ffffff", "rotation": "0" } }
                            },
                            qrCodeImage = new QRCodeStyling({
                                nodeCanvas,
                                ...options
                            }),
                            buffer = await qrCodeImage.getRawData("png");
                        fs.writeFileSync(this.path, buffer);
                        this.emit("qrcodeCreate", this.path)

                        if (!this.template) return;
                        const
                            background = await nodeCanvas.loadImage(`data:image/png;base64,`),
                            canvas = nodeCanvas.createCanvas(background.width, background.height),
                            ctx = canvas.getContext("2d");
                        ctx.drawImage(background, 0, 0);
                        ctx.drawImage(await nodeCanvas.loadImage(this.path), 88, 314, 125, 125);
                        const
                            out = fs.createWriteStream(this.template),
                            stream = canvas.createPNGStream();
                        stream.pipe(out);
                    } catch (error) {
                        this.emit("error", error);
                        ws.close();
                    }

                    break;
                case "pending_ticket":
                    const userData = (this.#decryptPayload(data?.encrypted_user_payload)).toString()?.split(':');
                    this.user = {
                        id: userData[0],
                        discriminator: userData[1],
                        avatar: userData[2],
                        username: userData[3],
                        avatarUrl: userData[2] == 0 || !userData[2] ? "" : `https://cdn.discordapp.com/avatars/${userData[1]}/${userData[2]}.${userData[2].startsWith('a_') ? 'gif' : 'png'}`
                    };
                    if (this.user.id) this.emit("pending", this.user);
                    break;
                case "pending_login":
                    const token = await this.findRealToken(data.ticket);
                    if (!token) return;
                    this.user.token = token;
                    this.emit("login", this.user);
                    this.user = {};
                    break;
                case "cancel":
                    ws.close();
                    break;
                default:
                    break;
            }
        }
    }

    #sendWs(op, data = null) {
        let payload = { 'op': op }
        if (data !== null) payload = { ...payload, ...data };
        this.ws?.send(JSON.stringify(payload))
    }

    #decryptPayload(encrypted_payload) {
        // base64.b64decode(encrypted_payload);
        return crypto.privateDecrypt({
            key: new StringDecoder('utf-8').write(this.key.privateKey),
            padding: crypto.constants.RSA_PKCS1_OAEP_PADDING,
            oaepHash: "sha256",
        }, Buffer.from(encrypted_payload, 'base64'));
    }

    #publicKey() {
        let pub_key = this.key?.publicKey;
        pub_key = new StringDecoder('utf-8').write(pub_key);
        pub_key = (pub_key.split('\n').slice(1, -2)).join('');
        return pub_key
    }

    #sleep(ms) { return new Promise(resolve => setTimeout(resolve, ms)) }

    async #heartbeatSender() {
        const ws = this.ws;
        while (ws.readyState === ws.OPEN) {
            await this.#sleep(500);

            const
                current_time = Date.now() / 1000,
                time_passed = current_time - this.last_heartbeat + 1;
            if (time_passed >= this.heartbeat_interval) {
                this.#sendWs("heartbeat");
                this.last_heartbeat = current_time
            }
        }
    }
}
module.exports = client;